insert into column_val (xmlid, col_xmlid, dataname, col_seq, colname, colcnname, datatype, length, precision_val, party_seq, isprimarykey, isnullable, remark, filed_type_child, sensitive_level, policyid) values ('TM_TYJ_G3_TARGET_USRCNT_MO','TM_TYJ_G3_TARGET_USRCNT_MO_2017104','TM_TYJ_G3_TARGET_USRCNT_MO','4','G3_TARGET_USRCNT','G3客户数目标值','INTEGER','','','','','Y','TD客户数目标值:是时间进度线每一天的目标值.时间进度线--设当月1日的值为A，月末日的值为B，定义：A＝上月月末日TD客户到达数×（自2月起每月1日TD客户到达数对比其上月月末日TD客户到达数下降比例的算术平均值）B＝当月应完成的KPI时间进度。本年目标增长值*当前月份/12+上年TD客户到达数.(本年目标增长值:2440000,上年TD客户到达数880000).例：4月3日时，A＝3月31日TD客户到达数×{[（2月1日数－1月31日数）/（1月31日数）＋（3月1日数－2月28日数）/（2月28日数）]/2}，B=(2440000)×（4/12）+880000','','','');
